import React from 'react';
import '../App.css';
import { Col, Row, Container } from 'reactstrap';
import  Banner from '../app/img/class-website-banner.png';
import readMore from '../app/img/read-about-eitan-button.png';
import Contact from '../app/img/contact-button.png';
import News from '../app/img/news.png';
import Logo from '../app/img/logo.jpg';
import Eitan from '../app/img/Eitans-portfolio-page-picture.png';

function Header() {
    return(
<div className='App'>
      <Container>
        <Row id= 'banner'>
           <Col className="col-6 col-md-4">
             <img src={Banner} alt='Banner' />            
           </Col>
           <Col className="col-6 col-md-4 d-none d-lg-block">
           <img id="logo" src={Logo} alt='September School logo' align="left"/>
           <h2 className="col-sm-3 col-md-4 d-none d-lg-block">Reawakening the love of learning for <strong>50 years</strong></h2>//           </Col>
//       </Row>
      </Container>
    </div>
    );
}

export default Header;
